
--==========================  USERS  =====================--

DROP USER AboutMe CASCADE;

CREATE USER AboutMe
IDENTIFIED BY _{AboutMe}_
DEFAULT TABLESPACE users
TEMPORARY TABLESPACE temp;

GRANT connect to AboutMe;
GRANT resource to AboutMe;
GRANT CREATE SESSION TO AboutMe;
GRANT CREATE TABLE TO AboutMe;
GRANT CREATE VIEW TO AboutMe;
GRANT CREATE MATERIALIZED VIEW TO AboutMe;
GRANT DEBUG CONNECT SESSION TO AboutMe;
GRANT DEBUG ANY PROCEDURE TO AboutMe;
GRANT create session to AboutMe;
ALTER USER AboutMe QUOTA 10m ON users;

conn AboutMe/_{AboutMe}_

--==========================  SEQUENCES  =====================--

CREATE SEQUENCE USER_ID_SEQ START WITH 1050;
CREATE SEQUENCE REMARK_ID_SEQ START WITH 1250;

--==========================  TABLES  =====================--

CREATE TABLE AM_USER (
  ID NUMBER PRIMARY KEY,
  NAME VARCHAR2(64),
  EMAIL VARCHAR2(128) UNIQUE,
  USER_TOKEN VARCHAR2(50),
  PASSWORD VARCHAR(128),
  PHOTO BLOB
);

CREATE TABLE REMARK(
  ID NUMBER PRIMARY KEY,
  POSTER_ID NUMBER,
  CONVERSATION_ID NUMBER,
  CONTENT CLOB,
  TIME_STAMP TIMESTAMP,
  CONSTRAINT FK_POSTER_REMARK FOREIGN KEY (POSTER_ID) REFERENCES AM_USER(ID)
);

CREATE TABLE HAS_READ(
  REMARK_ID NUMBER,
  USER_ID NUMBER,
  CONSTRAINT FK_REMARK_HAS_READ FOREIGN KEY (REMARK_ID) REFERENCES REMARK(ID),
  CONSTRAINT FK_USER_HAS_READ FOREIGN KEY (USER_ID) REFERENCES AM_USER(ID),
  CONSTRAINT COMP_PK_HAS_READ PRIMARY KEY (REMARK_ID, USER_ID)
);

CREATE TABLE COLLAPSE_USER(
  FOR_USER_ID NUMBER,
  TARGET_USER_ID NUMBER,
  CONSTRAINT FK_FOR_USER FOREIGN KEY (FOR_USER_ID) REFERENCES AM_USER(ID),
  CONSTRAINT FK_TARGET_USER FOREIGN KEY (TARGET_USER_ID) REFERENCES AM_USER(ID),
  CONSTRAINT COMP_PK_COLLAPSE_USER PRIMARY KEY (FOR_USER_ID, TARGET_USER_ID)
);

